import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';


const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    return(
    <>hello</>
    <>hello</>
    <App />
    <App />
    <>hello</>
    )
  </React.StrictMode>
);
